import React, { useEffect, useState } from 'react';
import { fetchData } from './fetchCall.js';

const access_token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjVkNTExOGYzZmJlNjI5MzE0OTc0Y2EwYiIsImlhdCI6MTU2NjYzOTkyN30.BOH7VjIdBgXL6riwgGGYFgVU9LVQaXGmLMgvWzVZ8ps";
const getStatusUrl = "https://dev.mai.family/api/v1/child/5d5119befbe629314974ca0d/assessment/5ce28e5b990bef450f1fdfc9";

const Status = () => {
    const [response, setResponse] = useState([])
    const getAssessment = async() => {
        const response = await fetchData(getStatusUrl, access_token);
        setResponse(response);
        return response;
        }

    useEffect(() => {
          getAssessment();
        },[])

    return ( <div style={{
    width: '100%',
    height: '100%',
    display: 'flex',
    justifyContent: 'center',
    alignContent: 'center',
    justifyItems: 'center',
    // alignItems: 'center'
    alignSelf: 'center'
    }}>
        {response.status}
        {console.log(response.data)}
        </div> );
}

export default Status;
